import './App.css';
import PropTypes from "prop-types";


// props : 부모 컴포넌트에서 자식 컴포넌트로 데이터를 전달하는 매개변수
// props는 읽기 전용
// 사용법 :
//          컴포넌트명(props) {
//              props.(부모가 전달한 키 이름);
//          }

//          컴포넌트명({부모가 전달한 키 이름, ...}) {
//              {키 이름1}, {키 이름2}, ...
//              console.log({키 이름});
//          }

//          컴포넌트명(props) {
//              const {키 이름, ...} = props;
//              console.log({키 이름});
//          }
function Food(props) {
    console.log(props.name);
    return (
        <div>
            <h3>I Love {props.name}</h3>
            <h4>{props.rating} / 5.0</h4>
            <img src={props.pic} />
        </div>
    );
}


const foodList = [
    {
        id: 1,
        name: "돈까스",
        rating: 4.5,
        image: "data:image/jpeg;base64,"
    },
    {
        id: 2,
        name: "돼지국밥",
        rating: 4.3,
        image: "data:image/jpeg;base64,"
    },
    {
        id: 3,
        name: "햄버거",
        rating: 4.0,
        image: "data:image/jpeg;base64,"
    }
];


function renderFood(dish) {
    return <Food key={dish.id} name={dish.name} pic={dish.image} rating={dish.rating} />;
}

function App() {
    //   이곳은 일반적인 js 소스코드 부분


    // return 화면을 생성하는 가상 DOM 부분
    return (
        // return 화면 렌더링 : 무조건 1개의 부모 html 태그만 사용 (자식 태그는 제한 없음)
        // jsx 문법에서 class라는 키워드는 자바스크립트의 class 키워드와 css 선택자가 겹치기 때문에 구분해주기 위해 css 선택자를 className으로 사용
        <div className="App">
            <h1>리액트 사용하기</h1>
            {/* SPA : Single Page Application 줄임말, index.html 과 같은 하나의 화면 구성 파일로 모든 화면을 구성하는 웹페이지
                SPA는 프론트엔드 프레임워크를 사용하여 하나의 화면에서 필요한 부분을 실시간으로 변경하여 웹을 표시함
                해당 화면을 구성하는 요소를 컴포넌트라고 함
            컴포넌트 : 리액트에서 화면을 구성하는 요소 */}

            {/* {} : jsx 문법에서 {}는 데이터를 표현하는데 사용함. 간단한 자바스크립트 연산식도 사용이 가능 */}

            {/* Food라는 컴포넌트에 변수명이 fav 이고, 값이 kimchi 인 데이터를 전달 */}
            {/* <Food name={"돈까스"} /> */}
            {/* <Food name={"돼지국밥"} /> */}
            {/* <Food name={"햄버거"} /> */}
            {/* {foodList.map(function(dish) { */}
            {/* <Food name={dish.name} /> */}
            {/* })} */}
            {/*{foodList.map((dish) => <Food name={dish.name} pic={dish.image} />)}*/}
            {foodList.map(renderFood)}
        </div>
    );
}

// 매개변수로 사용되는 데이터를 체크
// 매개변수의 이름까지 체크할 수 있음
// isRequired : 해당 부분이 반드시 필요하다는 의미, 없으면 오류발생
Food.propTypes = {
    name: PropTypes.string.isRequired,
    pic: PropTypes.string.isRequired,
    rating: PropTypes.number.isRequired
};

export default App;
